function request(url, data, callbacks, method)
{
    if(!callbacks){
        callbacks = {};
    }

    if(!callbacks.success){
        callbacks.success = function(){};
    }

    if(!callbacks.error){
        callbacks.error = function(){};
    }
    $.ajax({
        url: url,
        data: data||{},
        method: method||'post',
        complete: function(xhr){
            callbacks.success(xhr);
        },
        error: function(xhr){
            callbacks.error(xhr);
        }
    })
}

